import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from 'auth/Login';
// import About from './pages/About';

const App = () => (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        {/*<Route path="/about" element={<About />} />*/}
      </Routes>
    </Router>
);

export default App;
